  margin-top: 0px;
  height: 100vh;
  width: 100%;
}
.tw-calendar-layout-main-area {
  height: 100%;
  width: 100%;
  display: flex;
  flex-direction: row;
}

.tw-calendar-draggable-region {
  cursor: grab;
  -webkit-app-region: drag;
}

.tw-calendar-search-layout-main-area {
  height: 100%;
  width: 100%;
  display: flex;
  flex-direction: column;
}
.tw-calendar-search-layout-main-area .tw-calendar-search-bar {
  height: 4em;
  width: 100%;
  display: flex;
  flex-direction: row;
}
.tw-calendar-search-layout-main-area .tw-calendar-search-calendar-container {
  height: calc(100vh - 4em);
}
.tw-calendar-search-bar .tw-calendar-search-bar-icon {
  height: 100%;
  aspect-ratio: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
}
.tw-calendar-search-bar .tw-calendar-search-bar-pagination {
  height: 100%;
  padding: 0 1em;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
}
.tw-calendar-search-bar .tw-calendar-search-bar-text-field {
  width: 100%;
  display: flex;
  margin: 0.1em;
  margin-left: 0;
}

.tw-calendar-layout-container p {
  margin: 0;
  height: 100%;
  width: 100%;
}

.event-calendar-container {
  height: 100vh;
  flex: 1;
}
.tw-calendar-layout-main-area div.event-calendar-sidebar {
  position: initial;
  display: flex;
  flex-direction: column;
  margin: 0;
}

.tc-page-controls svg.tc-image-tmd-calendar-cursor {
  fill: <<colour toolbar-options-button>>;
}
","type":"text/vnd.tiddlywiki","tags":"$:/tags/Stylesheet"},"$:/plugins/linonetwo/tw-calendar/tiddlywiki-ui/PageLayout/EventsCalendarLayout":{"title":"$:/plugins/linonetwo/tw-calendar/tiddlywiki-ui/PageLayout/EventsCalendarLayout","name":"<<lingo EventsCalendar/Caption $:/plugins/linonetwo/tw-calendar/language/>>","description":"<<lingo EventsCalendar/Description $:/plugins/linonetwo/tw-calendar/language/>>","tags":"$:/tags/Layout","icon":"$:/plugins/linonetwo/tw-calendar/tiddlywiki-ui/Images/EventCalendar","text":"\whitespace trim
\define containerClasses()
tc-page-container tc-page-view-$(storyviewTitle)$ tc-language-$(languageTitle)$ tw-calendar-layout-container
\end
\import [subfilter{$:/core/config/GlobalImportFilter}]

<$vars
	tv-config-toolbar-icons={{$:/config/Toolbar/Icons}}
	tv-config-toolbar-text={{$:/config/Toolbar/Text}}
	tv-config-toolbar-class={{$:/config/Toolbar/ButtonClass}}
	tv-show-missing-links={{$:/config/MissingLinks}}
	storyviewTitle={{$:/view}}
	languageTitle={{{ [{$:/language}get[name]] }}}>
	<div class=<<containerClasses>>>
		<$navigator story="$:/StoryList" history="$:/HistoryList" openLinkFromInsideRiver={{$:/config/Navigation/openLinkFromInsideRiver}} openLinkFromOutsideRiver={{$:/config/Navigation/openLinkFromOutsideRiver}} relinkOnRename={{$:/config/RelinkOnRename}}>
			{{$:/core/ui/CommandPaletteTemplate}}
			<main class="tw-calendar-layout-main-area">
				<div class="event-calendar-container">
					<$calendar
						height="100%"
						filter="[all[tiddlers]!is[system]field:calendarEntry[yes]]"
						initialView={{$:/state/Calendar/PageLayout/EventCalendar/initialParams!!initialView}}
						initialDate={{$:/state/Calendar/PageLayout/EventCalendar/initialParams!!initialDate}}
					/>
				</div>
				<$reveal state="$:/state/event-calendar-sidebar" type="match" text="yes" default="no" retain="yes" animate="yes">
					{{$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/ViewTemplate/EventCalendarSidebar}}
				</$reveal>
			</main>
		</$navigator>
	</div>
</$vars>"},"$:/plugins/linonetwo/tw-calendar/tiddlywiki-ui/PageLayout/EventsCalendarSearchLayout":{"title":"$:/plugins/linonetwo/tw-calendar/tiddlywiki-ui/PageLayout/EventsCalendarSearchLayout","name":"<<lingo SearchCalendar/Caption $:/plugins/linonetwo/tw-calendar/language/>>","description":"<<lingo SearchCalendar/Description $:/plugins/linonetwo/tw-calendar/language/>>","tags":"$:/tags/Layout","icon":"$:/plugins/linonetwo/tw-calendar/tiddlywiki-ui/Images/CalendarSearchImage","throttle.refresh":"true","text":"\whitespace trim
\define containerClasses()
