  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
  width: 100%;
}
.tw-calendar-layout-create-new-tiddler-popup .tw-calendar-title-input {
  width: 100%;
}
.tw-calendar-layout-create-new-tiddler-popup {
  margin: 10px 0;
}
.tw-calendar-layout-create-new-tiddler-popup .tw-calendar-tags-input {
  display: flex;
  flex-direction: row;
  align-items: flex-start;
  max-width: 100%;
  overflow-x: auto;
  overflow-y: hidden;
  width: 100%;
}
.tw-calendar-layout-create-new-tiddler-popup .tw-calendar-tags-input .tw-calendar-frequently-used-tags {
  max-width: 180%;
}
.tw-calendar-layout-create-new-tiddler-popup .tw-calendar-tags-input .tc-edit-tags {
  padding-left: 0;
  border: unset;
  width: 180%;
}
.tw-calendar-empty-list-help-text {
  margin: 0;
}
.tw-calendar-layout-create-new-tiddler-popup .tc-edit-texteditor {
  width: 100%;
}

.tw-calendar-footer-buttons {
  display: flex;
  justify-content: space-between;
}
.tw-calendar-footer-button {
  width: 50%;
  height: 3em;
  margin-top: 10px;
}

span.tc-add-tag-name input {
  min-width: 5em;
}
.tw-calendar-alarms {
  display: flex;
  flex-direction: column;
  overflow-x: auto;
  width: 100%;
  margin-top: 2em;
}
.tw-calendar-alarms input.alarmMsg {
  margin-top: 0.5em;
  width: 100%;
}
.tw-calendar-alarms input.alarmEdit {
  width: 2em;
}
.tw-calendar-alarms input.alarmEdit.alarmEditYear {
  width: 4em;
}
.tw-calendar-alarms .alarmTable td {
  vertical-align: middle;
}","type":"text/vnd.tiddlywiki","tags":"$:/tags/Stylesheet"},"$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/CreateNewTiddlerPopup":{"title":"$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/CreateNewTiddlerPopup","subtitle":"<<lingo Modal/CreateEvent/Caption $:/plugins/linonetwo/tw-calendar/language/>>","footer":"{{$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/CreateNewTiddlerPopupFooter}}","text":"\import [subfilter{$:/core/config/GlobalImportFilter}]
\define lingo-base() $:/plugins/linonetwo/tw-calendar/language/

<div class="tw-calendar-layout-create-new-tiddler-popup">
  <small><<lingo Modal/CreateEvent/Label/Title>> {{$:/plugins/linonetwo/tw-calendar/settings/prefix}}{{$:/state/Calendar/PageLayout/create-tiddler!!draft.title}}</small>
  <<lingo Modal/CreateEvent/Label/Caption>>
  <$edit-text
    tiddler="$:/state/Calendar/PageLayout/create-tiddler-caption"
    field="draft.title"
    class="tc-titlebar tc-edit-texteditor"
    default=""
    tabindex="1"
    focus="true"
    cancelPopups="yes"
    fileDrop="no"
  />
  <<lingo Modal/CreateEvent/Label/Text>> 
  <$let currentTiddler="$:/state/Calendar/PageLayout/create-tiddler">
    <$edit-text
      field="text"
      class="tc-edit-texteditor tc-edit-texteditor-body"
      default=""
      placeholder={{$:/language/EditTemplate/Body/Placeholder}}
      tabindex=-1
      focus=false
      cancelPopups="yes"
      fileDrop="no"
      minHeight="30px"
    />
    <div class="tw-calendar-tags-input">
      {{||$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/FrequentlyUsedTagsList}}
      <div class="tw-calendar-tags-input-new-tag">
      {{||$:/core/ui/EditTemplate/tags}}
      </div>
    </div>
    <div class="tw-calendar-alarms">
      {{||$:/plugins/linonetwo/tw-calendar/lib/TiddlyTools/Time/Alarms}}
    </div>
    {{||$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/EventPreview/PluginDefaultViewTemplate}}
  </$let>
</div>
"},"$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/CreateNewTiddlerPopupFooter":{"title":"$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/CreateNewTiddlerPopupFooter","text":"\define lingo-base() $:/plugins/linonetwo/tw-calendar/language/
\define cleanUpAction()
<$action-setfield
  $tiddler="$:/state/Calendar/PageLayout/create-tiddler"
  text=""
  tags=""
  draft.title=""
  startDate=""
  endDate=""
/>
<$action-setfield
  $tiddler="$:/state/Calendar/PageLayout/create-tiddler-caption"
  draft.title=""
/>
<!-- alarm -->
<$action-setfield      $tiddler="$:/state/Calendar/PageLayout/create-tiddler" alarms="" />
<$action-deletetiddler $tiddler="$:/temp/time/alarms_input/$:/state/Calendar/PageLayout/create-tiddler"  />
<$action-deletetiddler $tiddler="$:/temp/time/alarms_msg/$:/state/Calendar/PageLayout/create-tiddler" />
\end

<!-- learn this from twMat https://groups.google.com/g/tiddlywiki/c/XXbzgRmcXF0 -->
<$wikify name="newtitle" text="{{$:/plugins/linonetwo/tw-calendar/settings/prefix}}{{$:/state/Calendar/PageLayout/create-tiddler!!draft.title}}" >

<div class="tw-calendar-footer-buttons">
  <$button class="tw-calendar-footer-button" message="tm-close-tiddler">
    <<lingo Modal/CreateEvent/Label/Cancel>>
    <<cleanUpAction>>
  </$button>


  <$button class="tw-calendar-footer-button" message="tm-close-tiddler">
    <<lingo Modal/CreateEvent/Label/Create>>
    <!-- Remove draft.title first -->
    <$action-setfield $tiddler="$:/state/Calendar/PageLayout/create-tiddler" $field="draft.title" />
    <$action-createtiddler
      $basetitle=<<newtitle>>
      $template="$:/state/Calendar/PageLayout/create-tiddler"
      caption={{$:/state/Calendar/PageLayout/create-tiddler-caption!!draft.title}}
      type="text/vnd.tiddlywiki"
    />
    <$let currentTiddler=<<createTiddler-title>> >
      <$action-sendmessage $message="tm-save-tiddler" $param=<<currentTiddler>> />
      <$action-sendmessage $message="tm-auto-save-wiki" />
    </$let>
    <<cleanUpAction>>
  </$button>
</div>
"},"$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/BottomButtons":{"title":"$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/BottomButtons","tags":"$:/tw-calendar/EventPreviewMiniViewTemplate","text":"\import [[$:/core/ui/EditTemplate]]

