  </$button>
</div>"},"$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/EditAlarm":{"title":"$:/plugins/linonetwo/tw-calendar/calendar-widget/tiddlywiki-ui/popup/EditAlarm","tags":"$:/tw-calendar/EventPreviewMiniViewTemplate","text":"<div class="tw-calendar-alarms">
